import React, { Component } from 'react';
import {Environment} from '../components/environment/index';
import axios from 'axios';
import { If, Then, Else, Switch, Case} from 'react-if';

class AddAddressPopup extends Component {

    constructor (props){
        super(props);

        // this.state = {
        //     information: [],
        //     quickLinks: [],
        //     gallery: [],
        //     weather: [],
        // }

        // axios.get(Environment.apiurl+'getInformation')
        //     .then(result => {
        //         if(result){
        //             this.setState({information: result.data.response});
        //         }
        //     });
    }

    render(){
        return (
            <div>
                <div class="modal popUp popUp1" id="addNew">
                    <div class="modal-dialog">
                        <div class="modal-content">
                            <div class="modal-body">
                                <button type="button" class="close" data-dismiss="modal">&times;</button>
                                <div class="mdLeft">
                                <div class="popupOverlay">
                                    <h3>Add New Address</h3>
                                </div>
                                </div>
                                <div class="mdRight">
                                    <div class="formBlock">
                                        <form action="" method="post">
                                        <div class="row">
                                            <aside class="col-sm-6">       
                                                <div class="form-group">
                                                    <label>Country <span>*</span></label>
                                                    <select>
                                                        <option>-- Select Country--</option>
                                                        <option>India</option>
                                                        <option>Australia</option>
                                                    </select>
                                                </div>
                                            </aside>
                                            <aside class="col-sm-6">
                                                <div class="form-group">
                                                    <label>State <span>*</span></label>
                                                    <select>
                                                        <option>-- Select State--</option>
                                                        <option>Delhi</option>
                                                    </select>
                                                </div>
                                            </aside>
                                        </div>
                                        <div class="row">
                                            <aside class="col-sm-6">
                                            <div class="form-group">
                                                <label>City <span>*</span></label>
                                                <select>
                                                    <option>-- Select City--</option>
                                                    <option>Mumbai</option>
                                                </select>
                                            </div>
                                            </aside>
                                            <aside class="col-sm-6">
                                                <div class="form-group">
                                                    <label>Address Type <span>*</span></label>
                                                    <div class="custRadio">
                                                        <label>
                                                            <input type="radio" checked="checked" name="radio" />
                                                            Home<span class="checkmark"></span> 
                                                        </label>
                                                        <label>
                                                            <input type="radio" name="radio" />
                                                            Work<span class="checkmark"></span> 
                                                        </label>
                                                    </div>
                                                </div>
                                            </aside>
                                        </div>
                                        <div class="form-group">
                                            <label>Addres (Area and Street)</label>
                                            <textarea></textarea>
                                        </div>
                                        <div class="row btnRow">
                                            <aside class="col-sm-6">
                                            <button type="submit" class="subMit">Save</button>
                                            </aside>
                                        </div>
                                        </form>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default AddAddressPopup;
